INSERT INTO `tbl_register_restaurants` VALUES ('832484269', 'Bougainvillier Restaurant', ';BAR;Western;French;European;Japanese;Khmer;Cafe;Dessert', '06.00am-11.30pm;-;06.00am-11.30pm', ';Outdoor Seating;Quiet/Relax;Free WiFi;River/Sea View;Live Music;VIP Room', ';Dinner;Buffet;Late Night;Lunch;Breakfast', ';Special Occation;Company Party;Business Meeting;Birthday/Anniversary;Group of Friends;Family with Children;Romantic Date;VIP', '', '', '', '', 'Fine Khmer Dishes and French Fare can be enjoyed in the stylish environs of the Bougainvillier Restaurant and Frangipania Roof Top Bar and Pizza', 'Free WiFi & Parking!', '3', '2011-08-29');
INSERT INTO `tbl_register_restaurants` VALUES ('1950202315', 'One More Restaurant', ';Asian;Vietnamese;Thai;Khmer;Local;BBQ;Cafe;Dessert;Vegetarians', '6:00AM-10:00PM;-;6:00AM-10:00PM', ';Quiet/Relax;Party Mood;Free WiFi;Nature;Live Music;VIP Room', ';Dinner;Catering;Delivery;Buffet;Take Out;Lunch;Breakfast', ';Special Occation;Company Party;Business Meeting;Birthday/Anniversary;Group of Friends;Family with Children;Romantic Date;VIP', 'Couples', '', '', '', 'Breakfast\r\nWe serve some of the most popular breakfast in town like Khmer Noodle Curry, Banh Houy, Banh Shong, Koy Chhay cake, Vietnam noodle, HaiNam Chicken Rice, Pad Thai, Fried Noodleâ€¦. \r\n\r\nLunch\r\nMany kind of foods will delight and serve your good time at our place with beef grill, Fish with Three Tastes, Oyster and Banana shoots salad, Steamed chicken with pandanus leaf, Fried Noodle, and many more. \r\n\r\nDinner\r\nEvery evening, all customers will enjoy romantic live music performed by local famous singers and also there are many our restaurant specialized cuisine to accompany your special dinner. \r\n\r\nWe offer all customers who would like to hold birthday parties, buffets, and other special gatherings. With our arrangement and quality service, your party will surely be enjoyable and unforgettable one. Especially we have free Wi-Fi, big parking space, enjoyable and unforgettable atmosphere.\r\n', 'One More Get More of What You Really Want!', '3', '2011-08-29');
